import React, { PureComponent } from "react";
import { Outlet, Link } from "react-router-dom";
import "../styles/categoryPage.css"


class CategoryPage extends PureComponent {

    render(){

        return (
            <>
            <h1 className="category-title">{this.props.category}</h1>
            <div className="listing-container">
            <div className="listing">
                <div className="listing-image"> <img src={this.props.state.productsAll[0].gallery[0]} className="listing-image"></img></div>
                <div className="listing-info">
                    <div className="listing-title"></div>
                    <div className="listing-price"></div>
                </div>
            </div>
            </div>
            </>
          )
    }

}

export default CategoryPage;
